import React from "react";
import ReactDOM from "react-dom";
/** @jsxRuntime classic */
/** @jsx jsx */
import { jsx } from "theme-ui";
import { Grid } from "theme-ui";
function MainPage() {
  return (
    <div
      sx={{
        display: "flex",
        flexDirection: "column",
        // minHeight: '100vh',
        height: "100vh",
        width: "100vw",
        bg: "#E7B996",
      }}
    >
      <Grid>
        <Box></Box>
        <Box></Box>
        <Box></Box>
        <Box></Box>
      </Grid>
    </div>
  );
}

export default MainPage;
